from pymongo import MongoClient, GEO2D, GEOSPHERE, ASCENDING
from bson.objectid import ObjectId
import random

def povodochek():
	return MongoClient().povodochek;

def shuffle_cities_in_advs():
	db = povodochek()
	for adv in db.sales.find():
		city_id = random.choice([city[1] for city  in cities[:]])
		db.sales.update(adv, {'$set':{'city_id': city_id}}, upsert = False)


def get_city_name(city_id, padezh = 'i'):
	city = cities.get(city_id)
	# return city.get('city_name_' + padezh) if city else u"" 
	return city.get('city_name') if city else u""

def get_city(city_id):
	return cities.get(city_id)

def get_city_region(city_id):
	city = cities.get(city_id)
	return format_city_region(city) if city else u"" 

def format_city_region(city):
	return u"{0}, {1}".format(city['city_name'], city['region_name'])

def update_db():
	db = povodochek()
	db.cities_tmp.drop()

	for c in cities.values():
		location = {'type': "Point", 'coordinates' : [ c['longitude'], c['latitude'] ] }
		db.cities_tmp.update({'city_id': c['city_id']}, \
			{'$set' : { 'city_id': c['city_id'], \
			'city_region' : format_city_region(c), \
			'city_size' : c['city_size'], \
			'location' :  location }}, \
			upsert=True)

		db.cities_tmp.ensure_index([("location", GEOSPHERE)])

		db.cities_tmp.ensure_index([("city_id", ASCENDING)])

	db.cities_tmp.rename('cities', dropTarget=True)

